import "./App.css";
import React from "react";
import Nav from "./Nav";
import Home from "./element/Home";
import Main from "./element/Main";
import InputPage from "./element/InputPage";
import { Route, Switch } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Nav />
      <main>
      <Switch>
        <Route path="/Home" >
          <Home />
        </Route>
        <Route path="/Main" >
          <Main />
        </Route>
        <Route path="/InputPage" >
          <InputPage />
        </Route>
        </Switch>
      </main>
    </div>
  );
}

export default App;
